('RE00000001', 'assets/img/residuos/bolsa.png', 'Bolsa de papel', 'Es cualquier material, objeto, sustancia o elemento solido que no tiene valor de uso para quien lo genera, pero que es susceptible de aprovechamiento para su reincorporación a un proceso productivo.', 'Limpio', 'assets/img/cestas/aprovechable.png', 'Aprovechable', 'Papel', 'assets/img/residuos/papel.png', 'Papel y cartón reciclado', 'Paquetes de hojas, envases de cartón, revistas y periódicos, papel de embalar, cajas de cartón, entre otros.'),
('RE00000002', 'assets/img/residuos/Periodico.png', 'Periodico', 'Es cualquier material, objeto, sustancia o elemento solido que no tiene valor de uso para quien lo genera, pero que es susceptible de aprovechamiento para su reincorporación a un proceso productivo.', 'Limpio', 'assets/img/cestas/aprovechable.png', 'Aprovechable', 'Papel', 'assets/img/residuos/papel.png', 'Papel y cartón reciclado', 'Paquetes de hojas, envases de cartón, revistas y periódicos, papel de embalar, cajas de cartón, entre otros.'),
('RE00000003', 'assets/img/residuos/mascarilla.png', 'Tapabocas', 'Los residuos peligrosos son todos aquellos elementos que luego de usarse ya no tienen una vida útil, no se pueden reciclar y además no deben ser mezclados con el resto de la basura que sacamos a diario.', '', 'assets/img/cestas/noaprovechable.png', 'No aprovechable', 'Peligroso', 'assets/img/residuos/cancelar.png', 'No se puede reciclar', 'desinfectar el tapabocas con alcohol o hipoclorito de sodio, luego destrúyelos con una tijera para evitar que los reutilicen, deposítalos en una bolsa negra, desinfecta la bolsa con alcohol y márcala como material peligroso. '),
('RE00000004', 'assets/img/residuos/apple.png', 'Desechos de comida', 'Los residuos orgánicos, son biodegradables, se componen naturalmente y tiene la propiedad de poder desintegrarse o degradarse rápidamente, transformándose en otra materia orgánica.', '', 'assets/img/cestas/organico.png', 'Organico', 'Comida', 'assets/img/residuos/fertilizante.png', 'Fertilizante', 'los recortes de árboles, los restos de poda, los desechos de comida y las excretas de algunos animales. Todos son residuos orgánicos que tienen la facultad de convertirse en compostaje o abono natural. '),
('RE00000005', 'assets/img/residuos/bottleV.png', 'Botella de vidrio', 'Es cualquier material, objeto, sustancia o elemento solido que no tiene valor de uso para quien lo genera, pero que es susceptible de aprovechamiento para su reincorporación a un proceso productivo.', '', 'assets/img/cestas/aprovechable.png', 'Aprovechable', 'Vidrio', 'assets/img/residuos/vidrio.png', 'Botellas o elementos de cristal', 'En las plantas de tratamiento los residuos se limpian de todo aquello que haya podido ser introducido en el iglú y que no sea propiamente vidrio. Luego el vidrio es triturado hasta convertirse en calcín (vidrio seleccionado, limpio y molido).');

